import { makeStyles } from "@material-ui/core";
import React from "react";

const style = makeStyles((theme) => ({
  root: {
    textAlign: "left",
    position: "absolute",
  },
}));

const Loader = () => {
  const classes = style();
  return <div className={classes.root}>Ciao</div>;
};
export default Loader;
